import React from 'react';
import Carousel, {consts} from "react-elastic-carousel";

const ServicesDetailedCaruselOne = () => {
    const breakPoints = [
        {width:0, itemsToShow: 1, className: "TexnologyCarusel", showArrows: true, pagination: false, enableMouseSwipe: false, disableArrowsOnEnd: true},
        {width:560, itemsToShow: 2, className: "TexnologyCarusel", showArrows: true, pagination: false, enableMouseSwipe: false, disableArrowsOnEnd: true},
    ];
    return (
        <Carousel breakPoints={breakPoints}>
            <div className='d-flex justify-content-center align-content-center flex-column w-100 position-relative'>
                <img className='ServDetailed-slider_img_small' src="/images/carysel/screen_one.png" alt=""/>
            </div>
            <div className='d-flex justify-content-center align-content-center flex-column w-100 position-relative'>
                <img className='ServDetailed-slider_img_small' src="../../images/carysel/screen_two.png" alt=""/>
            </div>
            <div className='d-flex justify-content-center align-content-center flex-column w-100 position-relative'>
                <img className='ServDetailed-slider_img_small' src="../../images/carysel/screen_three.png" alt=""/>
            </div>
            <div className='d-flex justify-content-center align-content-center flex-column w-100 position-relative'>
                <img className='ServDetailed-slider_img_small' src="../../images/carysel/screen_four.png" alt=""/>
            </div>
            <div className='d-flex justify-content-center align-content-center flex-column w-100 position-relative'>
                <img className='ServDetailed-slider_img_small' src="../../images/carysel/screen_five.png" alt=""/>
            </div>

        </Carousel>
    );
};

export default ServicesDetailedCaruselOne;
